function renderContentMenu(options, id) {
    var catePart = $("<div class='cate_part' id=" + id + "></div>");
    var catePartCol1 = $("<div class='cate_part_col1'></div>");
    var cateChannel = $("<div class='cate_channel'></div>");
    var cateDetail = $("<div class='cate_detail'></div>");
    var catePartCol2 = $("<div class='cate_part_col2'></div>");
    var cateBrand = $("<div class='cate_brand'></div>");
    var catePromotion = $("<div class='cate_promotion'></div>");
    catePart.append(catePartCol1).append(catePartCol2);
    catePartCol1.append(cateChannel).append(cateDetail)
    cateDetail.append(dl);
    catePartCol2.append(cateBrand).append(catePromotion);
    $(".fs_act#J_popCtn").append(catePart);
    var dl;
    options.left.title.forEach(function (item) {
        cateChannel.append($("<a href=" + item.href + ">" + item.name + "</a>"))
    })
    options.left.dl.forEach(function (item) {
        dl = $("<dl><dt class='cate_detail_tit'><a href=" + item.href + "></a>" + item.dt + "</dt></dl>");
        item.dd.forEach(function (item) {
            dl.append("<dd class='cate_detail_con'><a href=" + item.href + ">" + item.name + "</a></dd>")
        })
        cateDetail.append(dl)
    })
    options.right.cate_brand.forEach(function (item) {
        cateBrand.append("<a href=" + item.href + "><img src=" + item.src + "></a>")
    })
    options.right.cate_promotion.forEach(function (item) {
        catePromotion.append("<a href=" + item.href + "><img src=" + item.src + "></a>")
    })
}
